import React from 'react';
import { StyleSheet, Text, View } from 'react-native';
import { NavigationContainer } from '@react-navigation/native';
import { createStackNavigator } from '@react-navigation/stack';
import { ThemeContext } from './ThemeContext';
import Home from './screens/Home';
import Vue1 from './screens/Vue1';
import Vue2 from './screens/Vue2';
import Vue20 from './screens/Vue20';
import Vue21 from './screens/Vue21';
import Vue22 from './screens/Vue22';
import Vue23 from './screens/Vue23';
import Vue4 from './screens/Vue4';

import Contact from './components/Contact';

import Vue40 from './screens/Vue40';
import Vue41 from './screens/Vue41';
import Vue42 from './screens/Vue42';  
import Vue43 from './screens/Vue43';
import Vue5 from './screens/Vue5';
import Vue50 from './screens/Vue50';
import Vue51 from './screens/Vue51';
import Vue52 from './screens/Vue52';
import Vue54 from './screens/Vue54';


const Stack = createStackNavigator();

export default class App extends React.Component {
 
  constructor(props){
    super(props)
    this.state= { friends: ["Toto", "Tati", "Tonton"]}
  }

  render() {
    return(
      <ThemeContext.Provider>
        <NavigationContainer>
          <Stack.Navigator>
              <Stack.Screen 
                name="Home"
                component={Home}
                  />
               <Stack.Screen 
                name="Vue4"
                component={Vue4}
              />
              <Stack.Screen 
                name="Vue40"
                component={Vue40}
              />
              <Stack.Screen 
                name="Vue41"
                component={Vue41}
              />
              <Stack.Screen 
                name="Vue42"
                component={Vue42}
              />
                 <Stack.Screen 
                name="Vue43"
                component={Vue43}
              />
              <Stack.Screen
                name ="Vue2"
                component={Vue2}
              />
              <Stack.Screen
                name = "Vue20"
                component = {Vue20}
              />
              <Stack.Screen
                name = "Vue21"
                component = {Vue21}
              />
              <Stack.Screen
                name = "Vue22"
                component = {Vue22}
              />
              <Stack.Screen
                name = "Vue23"
                component = {Vue23}
              />
              <Stack.Screen
                name="Vue1"
                component={Vue1}
              />
              <Stack.Screen
                name="Contact"
                component={Contact}
              />
              <Stack.Screen
                name="Vue5"
                component={Vue5}
              />
              <Stack.Screen
                name="Vue50"
                component={Vue50}
              />
              <Stack.Screen
                name="Vue51"
                component={Vue51}
              />
              <Stack.Screen
                name="Vue52"
                component={Vue52}
              />
              <Stack.Screen
                name="Vue54"
                component={Vue54}
              />
          </Stack.Navigator>
        </NavigationContainer>
      </ThemeContext.Provider>
    );
  }
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#fff',
    alignItems: 'center',
    justifyContent: 'center',
  },
});
